                switch (name)
                {
                    case "id":
                        base.Id = (System.Guid)value;
                        Attributes["asyncoperationid"] = base.Id;
                        break;
                    case "asyncoperationid":
                        var id = (System.Nullable<System.Guid>) value;
                        if(id == null){ continue; }
                        base.Id = id.Value;
                        Attributes[name] = base.Id;
                        break;
